import React from "react";
import { useLocation } from "react-router-dom";

function Learn() {
  const { state } = useLocation();
  const { lesson, level, kanji } = state;

  return (
    <div className="App">
      <div>
        {" "}
        {console.log(kanji)} THIS IS THE LEARN PAGE いらっしゃいませ〜! you
        chose L{lesson} and you are in JAPN {level}
        {". "}
        {kanji[0]}
      </div>
    </div>
  );
}

export default Learn;
